def str_to_bool(val: str) -> bool:
    """Takes string and tries to turn it into bool as human would do.

    If val is in case insensitive (
    "y", "yes", "yep", "yup", "t",
    "true", "on", "enable", "enabled", "1"
    ) returns True.
    If val is in case insensitive (
    "n", "no", "f", "false", "off", "disable", "disabled", "0"
    ) returns False.
    Else Raise ValueError."""
    true_values = {
        "y", "yes", "yep", "yup", "t",
        "true", "on", "enable", "enabled", "1"
    }
    false_values = {
        "n", "no", "f", "false", "off", "disable", "disabled", "0"
    }

    val_lower = val.strip().lower()
    if val_lower in true_values:
        return True
    elif val_lower in false_values:
        return False
    else:
        raise ValueError(f"Cannot convert string to bool: '{val}'")

